/*!40000 ALTER TABLE `mfp_classes` DISABLE KEYS */;
INSERT INTO `mfp_classes` VALUES (38,'GO','Общее назначение','Для детей','Дети любят рисовать на компьютере, а кое-что достойно перевода на бумагу.\n\n<strong>Рекомендуемые категории продуктов:</strong><ul><li>Недорогой цветной струйник (примерно, до 8 тыс. руб.)</li><li>Если рисунков много, то выгоднее будет приобрести несколько более дорогой принтер (до 10–12 тыс. руб) с бОльшими контейнерами для чернил.</li></ul>\nЕсли для рисования используется планшет, желательно, чтобы принтер поддерживал Wi-Fi.','1 Для детей'),(41,'GO','Фото','Для печати фото (любительский)','Печать и копирование фотографий и оцифровка альбомов старых снимков в любительском качестве\n\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Цветной струйный принтер 4–6 цветов.</li><li>Для черно-белой фотографии – монохромный струйник.</li></ul>','4 Для любителей цифрового фото'),(42,'GO','Фото','Для печати фото (профессиональный)','Печать фотографий в высоком качестве \n<strong>Рекоммендуется:</strong> Струйный принтер 6 и более цветов формата А3+','5 Для профессионалов цифрового фото'),(43,'GO','Коммерческий','Для офиса с умеренной печатью','Печать, копирование, сканирование черно-белое или цветное в форматах А4 или А3.\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Черно-белый лазерный или струйный принтер/МФУ для рабочих групп с дуплексом и сетевым интерфейсом, формата А4 или А3.</li><li>Цветной офисный струйник с дуплексом и сетью</li><li>Цветной лазерный принтер/МФУ начальной или средней производительности.</li></ul>','7 Для офиса с умеренной печатью '),(44,'GO','Коммерческий','Для офиса с интенсивной печатью','Регулярные печать и копирование большого объема документов \n<strong>Рекомендуются:</strong> Высокопроизводительные лазерные и струйные принтеры или МФУ ','8 Для офиса с интенсивной печатью'),(45,'CL','Тип аппарата','Принтер','Только принтер','1 Принтеры'),(46,'CL','Тип аппарата','Настольный МФУ','Многофункциональное устройство формата A4','2 Настольные МФУ А4'),(47,'CL','Технология печати','Лазерный','','3 Лазерные'),(48,'CL','Технология печати','Струйный','','4 Струйные'),(49,'CL','Цвет','Черно-белый','','5 Монохромные'),(50,'CL','Цвет','Цветной','','6 Цветные'),(51,'CL','Коммуникации','Wi-Fi','Возможность беспроводного подключения','7 Наличие Wi-Fi'),(52,'CL','','Высокопроизводительный','Высокая скорость печати','8 Высокопроизводительные'),(53,'GO','Общее назначение','Для учащихся','Школьники и студенты могут распечатывать материалы из Сети, копировать или оцифровывать конспекты, квитанции, справки и т.д.\n\n<strong>Рекомендуемые категории продуктов:</strong><ul><li>Лучше всего для этого подходят недорогие черно/белые лазерные МФУ.</li><li>Если печатать/копировать часто и много, подойдут монохромные струйные МФУ.</li><li>Если только печатать – дешевле обойдутся черно/белые принтеры.</li></ul> \nСкорость печати - до 30 стр/мин.','2 Для школьников и студентов'),(54,'GO','Общее назначение','Для домашних дел','Для дома лучше всего подходят недорогие черно/белые лазерные МФУ. \n<ul><li>Лучше всего для этого подходят недорогие черно/белые лазерные МФУ.</li><li>Если печатать/копировать часто и много, подойдут монохромные струйные МФУ.</li><li>Если только печатать – дешевле обойдутся черно/белые принтеры.</li></ul> \nСкорость печати - до 30 стр/мин.','3 Для домашних дел'),(55,'GO','Коммерческий','Для малого и домашнего офиса','Печать, копирование, сканирование материалов в форматах А4 или А3.\nПри необходимости – отправка и получение факсов\n\n<strong>Рекомендуемые категории продуктов:</strong>\n<ul><li>Черно-белое лазерное или струйное МФУ, если только печать – принтер.</li><li>Недорогой цветной лазерный принтер или МФУ</li></ul>','6 Для малого и домашнего офиса');
/*!40000 ALTER TABLE `mfp_classes` ENABLE KEYS */;
UNLOCK TABLES;

