CREATE TABLE `nb_products` (
  `id` int NOT NULL AUTO_INCREMENT,
  `brand` varchar(45) DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
  `cluster` varchar(45) DEFAULT NULL,
  `target_market` varchar(45) DEFAULT NULL,
  `cpu_vendor` varchar(45) DEFAULT NULL,
  `base_platform` varchar(45) DEFAULT NULL,
  `gpu_list` varchar(255) DEFAULT NULL,
  `screen_size` varchar(45) DEFAULT NULL,
  `screen_resulution_list` varchar(45) DEFAULT NULL,
  `touchscreen` varchar(45) DEFAULT NULL,
  `appear_month` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5460 DEFAULT CHARSET=utf8;
