INSERT INTO `txt_how` VALUES (4,'4','Intel Evo: что значит эта наклейка на корпусе ноутбука?','Полная спецификация Intel Evo 2021. Актуальные модели ультрабуков c сертификацией Intel Evo. (Лето 2021)','Intel Evo – это свод требований и рекомендаций для производителей ноутбуков и трансформеров 2-in-1 от поставщика процессоров. В целом, эта наклейка должна гарантировать покупателю, что он приобретает действительно качественный современный компактный ноутбук.\r\nРазберемся, что же кроется за сертификацией Intel Evo на самом деле...','<p><strong>Intel Evo</strong> &ndash; это свод требований и рекомендаций для производителей ноутбуков и трансформеров 2-in-1 от поставщика процессоров. В целом, эта наклейка должна гарантировать покупателю, что он приобретает действительно качественный современный компактный ноутбук.</p>\r\n\r\n<p><br />\r\nФактически обозначены требования к устройствам по таким базовым направлениям, как:&nbsp;<img alt=\"Intel Evo\" src=\"/static/marketability/pict/how/Evo.jpg\" style=\"float:right; margin-left:10px; margin-right:10px; width:100px\" /></p>\r\n\r\n<ul>\r\n	<li>Предельные габариты</li>\r\n	<li>Качество дисплея</li>\r\n	<li>Звук - микрофоны и динамики</li>\r\n	<li>Качество камеры</li>\r\n	<li>Скорость включения</li>\r\n	<li>Производительность и Отзывчивость,&nbsp;</li>\r\n	<li>Время автономной работы и прочие моменты связанные с батарей,&nbsp;</li>\r\n	<li>Возможности подключения&nbsp;</li>\r\n</ul>\r\n\r\n<p>Мы приводим <strong><a href=\"#certiif\">список требований</a></strong> и актуальный&nbsp;на текущий момент (лето 2021 года) <a href=\"#models\"><strong>список моделей</strong></a> от основных производителей имеющих сертификат соответствия Evo.</p>\r\n\r\n<h2>Полная спецификация Evo</h2>\r\n\r\n<p>Формально, Intel Evo&trade; &ndash; это техническая спецификация, наподобие действовавшей несколько лет назад спецификации Ultrabook&trade;. (Само понятие <a href=\"https://allgid.ru/Nb/?Ультрабук=Yes&amp;tabs=marketability\"><strong>&quot;Ультрабук</strong>&quot;</a> на сегодня размылось, и стало обозначать почти любые компактные ноутбуки. Но изначально так назывался именно свод предписаний к производителям ноутбуков. <strong><a href=\"https://zen.yandex.ru/media/id/60a9bdd6a4aad1743d7ea041/60f1957f4b5d8b6f293ebf2f\">Более подробно это история описана в версии данной статьи для Яндекс.Дзен</a></strong>)&nbsp;</p>\r\n\r\n<p><br />\r\n<img alt=\"Intel Evo\" src=\"/static/marketability/pict/how/evo_case.jpg\" style=\"float:left; height:129px; margin-left:10px; margin-right:10px; width:167px\" />Логотип Evo является новым названием инициативы Intel, ранее известной как, Project Athena, считающейся, в свою очередь, идейной наследницей Ultrabook.&nbsp;<br />\r\nЗапуск Evo был приурочен к старту актуального на сегодня 11-го поколения процессоров Intel Core 11xxG7 под кодовым именем Tiger Lake.<br />\r\nЗдесь описаны многие параметры тонких и легких ноутбуков с экранами до 15 дюйм включительно.&nbsp;</p>\r\n\r\n<div class=\"inarticle_disclaimer\">\r\n<p>✎ Во многих материалах в Сети упоминается, что экран должен быть исключительно сенсорным, а сам ноутбук являться трансформером. По факту - это не так. Сертификацию Evo имеют многие модели и с обычным экраном, а вовсе не трансформеры.&nbsp;</p>\r\n</div>\r\n\r\n<p>Важно, что обозначаются не только базовые характеристики компьютера &ndash; процессор, память, накопитель. Главное, четко перечислены моменты, над которыми большинство пользователей обычно не задумывается: стандарты связи, параметры звука, батареи и проч.&nbsp;</p>\r\n\r\n<p>Не все из предписанных параметров вообще упоминаются в описаниях продуктов на Интернет-площадках, и уж тем более никак не обозначены на ценнике в офлайн магазине. А если частично и указываются в перечне характеристик, то в формате непонятных простому покупателю цифр, аббревиатур и т. п. Из которых рядовому пользователю бывает сложно сделать какой-либо вывод.&nbsp;</p>\r\n\r\n<p>Но ведь именно совокупность этих факторов,&nbsp;в конечном счете, и делает мобильных ПК действительно <strong>КАЧЕСТВЕННЫМ.</strong></p>\r\n\r\n<h2 id=\"certiif\" name=\"certiif\">Требования на сертификацию Intel Evo</h2>\r\n\r\n<h4>Форм-фактор:&nbsp;</h4>\r\n\r\n<ul>\r\n	<li>От 12 до 15 дюймов. (Но по факту имеются модели и&nbsp;16&rdquo;-17&quot;).</li>\r\n	<li>Предпочтительны (НО НЕ ОБЯЗАТЕЛЬНЫ) устройства с сенсорными дисплеями &nbsp;конструкции &ldquo;трансформер с поворотным экраном&rdquo;</li>\r\n	<li>Рекомендованная толщина корпуса -&nbsp;<strong>15 мм</strong>. Максимально допустимая - 19 мм.</li>\r\n	<li>Узкие рамки вокруг дисплея. Экран должен занимать более 80% площади устройства.</li>\r\n</ul>\r\n\r\n<h4>Базовая начинка</h4>\r\n\r\n<ul>\r\n	<li>Процессор Intel Core Gen11 (Tiger Lake). Четырехъядерный 11xxG7&nbsp;- &nbsp;<strong>i5</strong> или <strong>i7</strong>.</li>\r\n	<li>Интегрированная графика <strong>Intel X<sup>e</sup></strong>.&nbsp;(Дискретная видеокарта применяться не должна.)</li>\r\n	<li>Память: от 8 Гб двухканальной ОЗУ</li>\r\n	<li>Накопитель: от 256 ГБ SSD; PCIe/NVMe</li>\r\n</ul>\r\n\r\n<h4>Дисплей</h4>\r\n\r\n<ul>\r\n	<li>Обычный или сенсорный, от 12 до 15 дюймов. (Допустимо 16&quot;/17&quot; при соблюдении параметров толщины корпуса и тонких рамках дисплея.)</li>\r\n	<li>Разрешение от FHD (от 1920x1080)</li>\r\n	<li>От 8-bit True Color. (От 16 млн цветов.)</li>\r\n	<li>Яркость не ниже 250 кд/м<sup>2</sup>.</li>\r\n	<li>Качественная заводская калибровка дисплея</li>\r\n	<li>100% цветовой охват sRGB</li>\r\n</ul>\r\n\r\n<h4>Параметры питания</h4>\r\n\r\n<ul>\r\n	<li>Время автономной работы от батареи не менее 9 ч.</li>\r\n	<li>Функция быстрой зарядки по USB Type-C</li>\r\n	<li>до 4 часов работы систем после менее чем 30 минут быстрой зарядки</li>\r\n	<li>Идентичная отзывчивость ноутбука при работе от батареи и от сети</li>\r\n</ul>\r\n\r\n<h4>Время активации</h4>\r\n\r\n<ul>\r\n	<li>Пробуждение из режима сна не менее чем за 1 сек.</li>\r\n</ul>\r\n\r\n<h4>Интерфейсы подключения и связи&nbsp;</h4>\r\n\r\n<p><em>(Встроены в платформу Intel Core Gen11)</em></p>\r\n\r\n<ul>\r\n	<li>Thunderbolt 4 c пропускной способностью 40 Гб/c. Возможность подключения до 4-х внешних мониторов.</li>\r\n	<li>Wi-Fi 6 802.11ax &nbsp;максимальная скорость до 11 Гбит/с</li>\r\n	<li>Bluetooth 5 с поддержкой Audio offload.</li>\r\n	<li>Опционально: мобильная связь SIM Intel 4G LTE или 5G</li>\r\n</ul>\r\n\r\n<h4>Звук</h4>\r\n\r\n<ul>\r\n	<li>Не менее двух микрофонов с соотношением сигнал/шум не менее 63 дБ и соответствием громкости &plusmn;1 дБ</li>\r\n	<li>Динамики со звуковым давлением не менее 78 дБ на расстоянии 50 см, частота басов менее 353 Гц</li>\r\n</ul>\r\n\r\n<h4>Камера</h4>\r\n\r\n<ul>\r\n	<li>веб-камера с разрешением не менее 720p при 30 FPS;</li>\r\n</ul>\r\n\r\n<h4><br />\r\nОперационная система</h4>\r\n\r\n<ul>\r\n	<li>Microsoft Windows 10. (Предписан также встроенный голоcовой помощник MS Cortana, однако, в России он не поддерживается.)</li>\r\n	<li>Chrome OS</li>\r\n</ul>\r\n\r\n<h2 id=\"models\" name=\"models\">Актуальные модели имеющие сертификацию Intel Evo</h2>\r\n\r\n<h3><br />\r\n13&rdquo; не сенсорный</h3>\r\n\r\n<ul>\r\n	<li><strong><a href=\"/Nb/4851\" target=\"_blank\">HP Envy 13-ba1000</a></strong></li>\r\n	<li><a href=\"/Nb/4843\"><strong>Asus ZenBook S UX393E</strong></a></li>\r\n	<li><a href=\"/Nb/4881\"><strong>Lenovo ThinkBook 13s-ITL Gen2</strong></a></li>\r\n</ul>\r\n\r\n<h3>13&rdquo; сенсорный 2-in-1</h3>\r\n\r\n<ul>\r\n	<li><a href=\"/Nb/4804\"><strong>Asus ZenBook Flip S UX371E</strong></a></li>\r\n	<li><a href=\"/Nb/4802\"><strong>Asus ZenBook Flip UX363EA</strong></a></li>\r\n	<li><a href=\"/Nb/4809\"><strong>Dell XPS 13 9310 2-in-1</strong></a></li>\r\n	<li><a href=\"/Nb/5061\"><strong>HP ENVY x360 13-bd0000</strong></a></li>\r\n	<li><a href=\"/Nb/4810\"><strong>HP Spectre x360 13-aw2000</strong></a></li>\r\n	<li><a href=\"/Nb/4955\"><strong>Lenovo ThinkPad X1 Nano Gen1</strong></a></li>\r\n	<li><a href=\"/Nb/5037\"><strong>Lenovo ThinkPad X1 Titanium Yoga Gen1</strong></a></li>\r\n</ul>\r\n\r\n<h3><br />\r\n14&rdquo; не сенсорный</h3>\r\n\r\n<ul>\r\n	<li><a href=\"/Nb/4831\"><strong>Acer Swift 3 SF314-59</strong></a></li>\r\n	<li><a href=\"/Nb/4796\"><strong>Asus ExpertBook B9400C</strong></a></li>\r\n	<li><a href=\"/Nb/4935\"><strong>Asus VivoBook S14 S435EA</strong></a></li>\r\n	<li><a href=\"/Nb/4844\"><strong>Asus ZenBook 14 Ultralight UX435E</strong></a></li>\r\n	<li><a href=\"/Nb/4842\"><strong>Asus Zenbook Duo UX482E</strong></a></li>\r\n	<li><a href=\"/Nb/4847\"><strong>Dell Inspiron 14 7400</strong></a></li>\r\n	<li><a href=\"/Nb/5070\"><strong>Lenovo ThinkPad X1 Carbon Gen9</strong></a></li>\r\n	<li><a href=\"/Nb/5042\"><strong>MSI Prestige 14 Evo A11M</strong></a></li>\r\n</ul>\r\n\r\n<h3><br />\r\n14&rdquo; сенсорный 2-in-1</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><a href=\"/Nb/4784\"><strong>Acer Swift 5 SF514-55TA</strong></a></li>\r\n	<li><a href=\"/Nb/4945\"><strong>HP Spectre x360 Convertible 14-ea0000</strong></a></li>\r\n	<li><a href=\"/Nb/4894\"><strong>Lenovo Yoga 7 14ITL05</strong></a></li>\r\n	<li><a href=\"/Nb/4898\"><strong>Lenovo Yoga 9i 14ITL5</strong></a></li>\r\n	<li><a href=\"/Nb/4901\"><strong>Lenovo Yoga Slim 9 14ITL5</strong></a></li>\r\n</ul>\r\n\r\n<h3><br />\r\nОт 15&rdquo; не сенсорный</h3>\r\n\r\n<ul>\r\n	<li><strong>LG Gram 16T90P</strong></li>\r\n	<li><strong>LG Gram 17</strong></li>\r\n</ul>\r\n\r\n<h3><br />\r\nОт 15&rdquo; сенсорный 2-in-1</h3>\r\n\r\n<ul>\r\n	<li><a href=\"/Nb/4896\"><strong>Lenovo Yoga 7 15ITL5</strong></a></li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>','<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?Ультрабук=Yes&amp;tabs=marketability\">Top-20 Ультрабуков</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?Ультрабук=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?Ультрабук=Yes&amp;tabs=marketability\">Ультрабук</a></div>\r\n</div>','Nb','2021-07-14','/static/marketability/pict/how/Evo.jpg',0,'Что такое Intel Evo?','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Intel Evo &ndash; это свод требований и рекомендаций для производителей ноутбуков и трансформеров 2-in-1 от поставщика процессоров. В целом, эта наклейка должна гарантировать покупателю, что он приобретает действительно качественный современный компактный ноутбук.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Фактически обозначены требования к устройствам по таким базовым направлениям, как:&nbsp;</span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Предельные габариты</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Производительность и Отзывчивость,&nbsp;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Качество дисплея</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Звук - микрофоны и динамики</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Качество камеры</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Скорость включения</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Время автономной работы и прочие моменты связанные с батарей&nbsp;</span></span></span></li>\r\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Возможности подключения&nbsp;</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Мы приводим <a href=\"https://allgid.ru/how/Nb/4#certif\"><strong>список требований </strong></a>по&nbsp;сертификации Intel Evo и актуальный&nbsp;<strong><a href=\"https://allgid.ru/how/Nb/4#models\">список Evo-моделей</a></strong> от основных производителей.</span></span></span></p>\r\n\r\n<p>&nbsp;</p>'),(5,'5','Как изменился рынок ноутбуков в 2021 году?','Интервью с менеджером Acer П. Василенко: технологии и особенности ноутбуков 2021 года','Руководитель направления мобильных устройств Acer в России Павел Василенко рассказывает, на какие технологии в сфере ноутбуков более всего возрос спрос сегодня, в 2021 году. \r\nУстройства среднего ценового сегмента для дистанционного образования, ARM-процессоры для ноутбуков, экраны 16:10, игровые ноутбуки для профессиональных задач и другие особенности настоящего периода в интервью менеджера Acer.','<p><em><img alt=\"Павел Василенко, Acer Россия\" src=\"/static/marketability/pict/how/acer_vasilenko.jpg\" style=\"margin-left: 10px; margin-right: 10px; float: right; width: 100px;\" />Технологии развиваются стремительно. С каждым годом различные девайсы, которые нас окружают, становятся все умнее и совершеннее. Появляются новые технические решения, старые фишки и неактуальные функции уходят в прошлое. </em></p>\r\n\r\n<p><em>Но и жизнь не стоит на месте: последний год сильно изменил наши поведенческие паттерны и привычные сценарии использования техники. Вместе с экспертом, руководителем направления мобильных устройств <strong>Acer</strong> в России <strong>Павлом Василенко</strong> разбираемся, что произошло на рынке ноутбуков в 2021 году.</em></p>\r\n\r\n<p>В прошлом году большинство изменений и трендов на рынке ноутбуков (и компьютеров в целом) было связано с <strong>пандемией</strong>. При этом они в первую очередь коснулись увеличенного спроса: из-за того, что школьники, студенты и большое количество работающих людей перешли на удаленку, многим пришлось обновить (или приобрести впервые) рабочую станцию. В фаворе были устройства среднего ценового сегмента: такие, на которых можно комфортно выполнять рабочие задачи, сидеть в интернете, иногда смотреть фильмы или сериалы и играть в компьютерные игры.</p>\r\n\r\n<h3>Новые процессоры</h3>\r\n\r\n<p>В целом этот тренд является актуальным и по сей день. Несмотря на то что большинство желающих уже успели обновить свой ноутбук в связи с наступлением ковидной реальности, пандемия продолжает диктовать потребителям запросы и ожидания от новой техники.</p>\r\n\r\n<p>Люди все больше ценят компактные, автономные, но мощные устройства &mdash; иными словами, <strong>универсальные</strong>. Чтобы можно было работать и из дома, и из офиса, играть, сидеть в соцсетях, заниматься творчеством &mdash; и все это с одного девайса.</p>\r\n\r\n<p>Поэтому один из главных трендов 2021 года (и немного конца 2020-го) &mdash; это использование в ноутбуках новых процессоров. Практически полная монополия Intel и AMD на производство десктопных решений подошла к концу. Осенью 2020 года Apple представила свой <a href=\"/Nb/4787\">первый ноутбук</a> на базе собственного <strong>ARM-чипа</strong>. Подобные устройства также показывают и на Windows, и на Chrome OS.</p>\r\n\r\n<p><strong>В России в продажу скоро поступят ноутбуки Acer на платформе Qualcomm.&nbsp;</strong></p>\r\n\r\n<p><img alt=\"Qualcomm Snapdragon\" src=\"/static/marketability/pict/how/snapdragon.jpg\" style=\"margin-right: 10px; float: left; width: 150px;\" />Основное преимущество ноутбуков с процессорами на архитектуре ARM перед устройствами с привычными Intel Core и AMD Ryzen &mdash; это тонкость и легкость (поскольку такие процессоры часто не нуждаются в активном охлаждении и ноутбук может обойтись без кулера, что экономит место). А также впечатляющая автономность: срок жизни от одного заряда аккумулятора у ноутбука с ARM-чипом может в 3 раза превышать срок жизни аналогичного ноутбука с традиционным решением.<br />\r\nКроме того, новые процессоры позволяют ноутбукам быстрее включаться и выходить из режима сна, запускать приложения и работать в режиме многозадачности.</p>\r\n\r\n<p><strong>Ноутбук 2-in-1&nbsp;<a href=\"/Nb/5402\">Acer&nbsp;Spin SP714-61N</a> - </strong>Qualcomm Snapdragon 8cx Gen2 / 14&quot; FHD Touch</p>\r\n\r\n<h3>Новые формы и фишки</h3>\r\n\r\n<p><img alt=\"16:10\" src=\"/static/marketability/pict/how/16_10.jpg\" style=\"margin: 10px; width: 70%;\" /></p>\r\n\r\n<p>Еще в самом начале года на выставке CES 2021 наметился другой тренд, и он связан с экранами. Изменилось их привычное соотношение сторон: от ставшего традиционным 16:9 экраны &laquo;вытягиваются вверх&raquo; &mdash; к соотношению <strong>16:10 </strong>или<strong> 3:2</strong>.&nbsp;<br />\r\nТакое изменение формата экрана в сторону &laquo;вертикализации&raquo; опять же связано с многофункциональностью ноутбуков и их постоянным использованием в режиме нескольких одновременно открытых окон. Ведь чем выше экран, тем больше строк текста, например, на него помещается.<br />\r\nЭти изменения в ближайшее время коснутся подавляющего большинства ноутбуков: на январской выставке новое соотношение сторон экрана не получили только наиболее бюджетные, а также геймерские устройства.<br />\r\nПомимо этого, в ноутбуках все чаще появляется возможность <strong>отключить веб-камеру или микрофон</strong> не с помощью программного обеспечения, но физически &mdash; при помощи специальной шторки или переключателя, который полностью отсоединяет камеру от системы. Причина очевидна: с переходом на гибридный режим работы, когда не все и не всегда могут находиться в офисе, видеоконференции стали проводиться гораздо чаще и людям важно чувствовать контроль над тем, что [не] видят и слышат собеседники.&nbsp;<br />\r\nВ эту же копилку отправляется тренд на появление в ноутбуках микрофонов с <strong>шумоподавлением</strong> (чтобы было слышно только вас, а не соседскую дрель) и веб-камер с портретным режимом (когда в кадре четко видно только вас, а задний фон размывается).</p>\r\n\r\n<h3>Работа, гейминг и творчество: смешение форматов</h3>\r\n\r\n<p>Как уже отмечалось выше, WfH и LfH (работа и учеба из дома) &mdash; важный тренд последних двух лет. Для большой части пользователей идеальными устройствами, которые могут закрыть все их каждодневные потребности, стали ноутбуки средней ценовой категории &mdash; то есть обычные устройства с достаточно высокой производительностью и нормальным набором остальных характеристик.<br />\r\n<img alt=\"Acer ConceptD\" src=\"/static/marketability/pict/how/conceptd.jpg\" style=\"margin-left: 10px; float: right; width: 150px; height: 126px;\" />Но что делать <strong>профессионалам</strong>, художникам и дизайнерам, создателям контента, геймерам? Для решения их задач нужны куда более продвинутые ноутбуки, поскольку эффективность работы во многом зависит именно от компьютера.<br />\r\nУ многих производителей есть отдельные линейки ноутбуков для криэйторов: MacBook Pro 16 у Apple или <a href=\"/Nb/4911\">ConceptD у Acer</a>. Но не всем удобно покупать два разных устройства для решения рабочих и личных задач.</p>\r\n\r\n<p><img alt=\"Acer Predator Helios 300 PH315-53\" src=\"/static/marketability/pict/how/predator.jpg\" style=\"float: left; width: 150px; height: 117px;\" />Хорошей альтернативой часто становятся геймерские ноутбуки: из-за своей высокой производительности они отлично подходят не только для требовательных игр, но и для работы. Мощная видеокарта пригодится для <strong>монтажа видео</strong> или 3D-графики, а процессор &mdash; для кодинга.<br />\r\nИз-за этого некоторые производители даже стали выпускать игровые ноутбуки в строгом и лаконичном дизайне (в противовес традиционно геймерскому обилию подсветки и брутальным линиям корпуса).<br />\r\n&nbsp;</p>','<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?Домашний=Yes&amp;tabs=marketability\">Top-20 Универсальных домашних ноутбуков</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?Домашний=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?Домашний=Yes&amp;tabs=marketability\">Универсальный домашний</a></div>\r\n</div>\r\n\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?Игровой=Yes&amp;tabs=marketability\">Top-20 Игровых ноутбуков</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?Игровой=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?Игровой=Yes&amp;tabs=marketability\">Игровой</a></div>\r\n</div>','Nb','2021-07-23','/static/marketability/pict/how/acer_vasilenko.jpg',0,'Как изменился рынок ноутбуков в 2021 году?','<p>Руководитель направления мобильных устройств Acer в России Павел Василенко рассказывает, на какие технологии в сфере ноутбуков более всего возрос спрос сегодня, в 2021 году.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Устройства среднего ценового сегмента для дистанционного образования;</li>\r\n	<li>Ноутбуки на базе ARM-процессоров;&nbsp;</li>\r\n	<li>Дисплеи&nbsp;с соотношением сторон 16:10;&nbsp;</li>\r\n	<li>Шумоподавление и возможность контроля камеры и миткрофона пользователем;</li>\r\n	<li>Использование игровых ноутбуков для&nbsp;профессиональных задач: 3D-дизайн, CAD-проектирование,&nbsp;видеомонтаж и поч.</li>\r\n</ul>'),(6,'6','Как выбрать недорогой ноутбук','Советы по выбору и актуальные модели хороших ноутбуков стоимостью иже 35 тыс. руб.','Выбор дешевой техники - ответственная задача. Ведь принцип “скупой платит дважды” никто не отменял. Как подобрать оптимальный ноутбук для своих потребностей, при этом не переплатить? Этому вопросу и посвящена наша статья.','<p>Выбор дешевой техники - ответственная задача. Ведь принцип &ldquo;скупой платит дважды&rdquo; никто не отменял. Как подобрать оптимальный ноутбук для своих потребностей, при этом не переплатить? Этому вопросу и посвящена наша статья.</p>\r\n\r\n<p><strong>Материал подготовлен по состоянию на лето 2021 года.</strong></p>\r\n\r\n<h2>Общие положения</h2>\r\n\r\n<p>В целом, на стоимость мобильного ПК влияют несколько факторов.&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Основная начинка компьютера, его конфигурация: процессор, объем оперативной памяти, емкость и тип накопителя (диска).&nbsp;</li>\r\n	<li>Диагональ экрана. Размер дисплея ноутбука&nbsp;определяет и его общие габариты и вес. Фактически, именно форм-фактор, выражаемый в размере диагонали дисплея в дюймах, определяет и общее предназначение ноута: выездное мобильное устройство для потребления контента, устройство ограниченной мобильности, замена настольного ПК.&nbsp;<br />\r\n	При этом, следует понимать, что в деле электроники&nbsp;&quot;миниатюрный&quot;, &quot;компактный&quot; - вовсе не означает &quot;дешевый&quot;. В целом даже наоборот. Но есть и исключения, в виде&nbsp;дешевых&nbsp;моделей мини-ноутбуков и даже трансформеров с поворотным экраном.</li>\r\n	<li>Естественно, общее &ldquo;качество&rdquo; - сборка, качество дисплея, материалы, бренд (торговая марка).</li>\r\n	<li>Стоит добавить также наличие установленной ОС Windows в конкретной модификации модели.</li>\r\n</ul>\r\n\r\n<h3>Процессоры для дешевых ноутбуков</h3>\r\n\r\n<p>Среди процессоров x86 (платформа ПК под ОС Windows) можно выделить три группы моделей нижнего ценового сегмента.&nbsp;</p>\r\n\r\n<p><img alt=\"PCMark CPU mark\" src=\"/static/marketability/pict/how/PCMark.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /></p>\r\n\r\n<p><em>Рисунок. На рисунке приведен тест CPU PC Mark который позволяет сопоставить примерную производительность некоторых распространенных моделей бюджетных процессоров.</em></p>\r\n\r\n<h4>1. Процессоры начального уровня (низковольтовые и малопотребляющие).</h4>\r\n\r\n<p><em><strong><span style=\"color:#16a085;\">На графике обозначены зеленым цветом.</span></strong></em></p>\r\n\r\n<p>Самые дешевые и низкопроизводительные чипы. При этом, за счет экономичности, они позволяют увеличить время автономной работы устройства без подзарядки от сети. (Теоретически, такие чипы изначально разрабатывались для планшетов, но были немного усилены и перенесены в сферу ноутбуков и малогабаритных ПК.)<br />\r\nЭти процессоры называются Intel <strong>Celeron</strong> и <strong>Pentium Silver</strong> серии <strong>&ldquo;N&rdquo;</strong>. Обозначаются в спецификациях, например, так: Celeron N4020, Pentium N5030, Pentium N6000.&nbsp;</p>\r\n\r\n<div class=\"inarticle_cit1\">\r\n<p>Поколения процессоров имеют кодовые имена. Актуальные на сегодня поколения маломощных чипов Intel:&nbsp;<strong>Gemini Lake</strong> и <strong>Jasper Lake</strong> (актуальное поколение на 2021 г.)</p>\r\n</div>\r\n\r\n<p>В современных поколениях чипов - эти чипы имеют по 4 ядра. Однако сами ядра - специальной экономичной архитектуры Atom - они сравнительно слабее, чем полноценные ядра Intel Core или AMD Zen.&nbsp;<br />\r\nПоэтому ноутбуки на этой базе работают менее плавно с одним конкретным приложением. Но вот в случае запуска нескольких приложений параллельно, за счет многоядерности, в среднем могут смотрятся не сильно хуже самых младших и устаревших 2-хъядерных процессоров из следующей группы (п. 2.)&nbsp;<br />\r\nВпрочем, много окон браузера или приложений на таких ноутбуках лучше все равно не открывать.&nbsp;</p>\r\n\r\n<h4>2. Младшие двухъядерные чипы из семейства полноценных мобильных процессоров.</h4>\r\n\r\n<p><em><strong><span style=\"color:#2980b9;\">На графике обозначены синим цветом.</span></strong></em></p>\r\n\r\n<p>Intel <strong>Celeron Gold</strong> или <strong>Pentium Gold</strong> серии &ldquo;U&rdquo; (прежнее обозначение), а также чипы AMD <strong>Athlon</strong> серии &ldquo;e&rdquo; или &ldquo;U&rdquo;.&nbsp;</p>\r\n\r\n<p>У Intel, правда, в современности эти модели обозначаются без буквенных индексов, например Pentium 6805 (<strong>Ice Lake</strong>) или новейший Pentium Gold 7505 (<strong>Tiger Lake</strong> - актуальное).</p>\r\n\r\n<h4>3. Стандартные 2-хъядерные процессоры серий Intel <strong>Core i3</strong> или 4-ядерные AMD <strong>Ryzen 3</strong>.</h4>\r\n\r\n<p><em><strong><span style=\"color:#c0392b;\">На графике обозначены красным цветом.&nbsp;</span></strong></em></p>\r\n\r\n<p>Чипы младшего-cреднего уровня производительности среди полноценных процессоров для мобильных ПК.&nbsp;</p>\r\n\r\n<p>Обозначаются у Intel, например,&nbsp;как Core i3-1000NG4 (Ice Lake) или Core i3-1115G4 (Tiger Lake - актуальное).<br />\r\nУ AMD, например, Ryzen 3 3250U (Picasso), Ryzen 3 4300U (Renior) или Ryzen 3 5300U (<strong>Lucienne</strong> - актуальное).</p>\r\n\r\n<h3>Оперативная память (ОЗУ)</h3>\r\n\r\n<p>Минимальный объем памяти для ноутбука на сегодня - это 4 ГБ. При этом ОЗУ - это тот ресурс, которого мало не бывает.&nbsp;<br />\r\n8 ГБ памяти - это нормальный уровень для комфортной работы на ноутбуке.&nbsp;<br />\r\nДело еще и в том, что все дешевые конфигурации обладают встроенной (интегрированной) графикой. А&nbsp;графический модуль встроен в&nbsp;тот же чип, что и центральный процессор. При такой конфигурации под память для графики отводится область из основной ОЗУ. (В этом отличие встроенной графики&nbsp;от внешней (дискретной) видеокарты, которая обладает собственной видеопамятью; там графический чип не задействует общие ресурсы системы.)<br />\r\nЭто означает, что если написано 4 ГБ памяти, то по факту а вас будет 3, а то и 2 ГБ для приложений и данных. А это уже, действительно, слишком мало.<br />\r\nТак что 8 ГБ - это тот уровень к которому нужно стремиться при выборе даже самого бюджетного ноутбука.</p>\r\n\r\n<h3>Накопитель (диск)</h3>\r\n\r\n<p>Большинство современных ноутбуков оснащается твердотельным накопителем SSD. Минимальный объем - 128 ГБ. Этого хватает для установки некоторого количества приложений и хранения незначительного объема архивов собственных файлов. Хотя лучше ориентироваться на 256 ГБ и более.<br />\r\nНадо помнить также, что часть собственных файлов из числа неиспользуемых постоянно сегодня можно вполне комфортно сохранять на бесплатных облачных хранилищах типа&nbsp;Google-Диск или &nbsp;Microsoft OnDrive.&nbsp;<br />\r\n(В принципе, свои архивы лучше сохранить на таких сетевых ресурсах в любом случае, в качестве резервной копии. Особенно рекомендуется это делать тем, кто постоянно носит ноутбук с собой, и вероятность его повреждения или утраты выше.)</p>\r\n\r\n<h3>Разрешение экрана</h3>\r\n\r\n<p>Разрешение - это количество точек (пикселей) в матрице дисплея по горизонтали и вертикали. Чем выше разрешение, тем лучше качество &ldquo;картинки&rdquo; и больший объем информации можно отобразить на экране.<br />\r\nДля бюджетных ноутбуков на сегодня используется два основных разрешения<br />\r\n<strong>HD</strong> (1366x768) и <strong>FHD</strong> (1920x1080). (Меньшие уже ушли в прошлое, бОльшие - не встречаются в дешевых ноутбуках.)<br />\r\nТут все зависит от диагонали дисплея. Для мини-ноутбуков до 11,6&rdquo; разрешение HD - приемлимо. Картинка получается довольно четкой. Для ноутов с диагональю от 14&rdquo; - это уже не очень хорошо, лучше ориентироваться на FHD. &nbsp;<br />\r\nНадо также помнить, что Windows по умолчанию подстраивает масштаб отображения информации на экране, в зависимости от его физического размера. Например для 14&rdquo; экрана по умолчанию может стоять увеличение изображения на 25% или 50%. Так шрифты текста и изображения получаются больше - воспринимаются&nbsp;комфортнее,&nbsp;но информации в целом на экране умещается меньше. (Это настраиваемый параметр. В Windows 10 это можно регулировать в разделе &ldquo;Параметры&rdquo; -&gt; &nbsp;&ldquo;Система&rdquo; -&gt; &ldquo;Дисплей&rdquo; -&gt; &ldquo;Масштаб и разметка&rdquo;. Но следует помнить, что на малых экранах настройка масштаба 100% приведет к крайне мелким, почти нечитаемым шрифтам и мелким&nbsp;изображениям).&nbsp;</p>\r\n\r\n<h2>Можно выделить несколько типов бюджетных ноутбуков</h2>\r\n\r\n<h3>Обычные мини-ноутбуки низкой производительности</h3>\r\n\r\n<p>Это ноутбуки с экранами 10&rdquo;-11,6&rdquo;. Такие модели предназначенные исключительно для коммуникаций, хождения&nbsp;по Интернет, просмотра видео, работы с простыми документами, например, набора&nbsp;текстов.&nbsp;<br />\r\nПодобный список сценариев использования, часто именуют <strong>&ldquo;потребление контента&rdquo;</strong>. В отличие от более продвинутых компьютеров, ориентированных уже на &ldquo;создание контента&rdquo;.<br />\r\nПри этом весят такие ноуты в районе 1 кг,&nbsp;и являются идеальным средством для поездок. Включая и работу в транспорте, городских кафе, в отпуске, командировке и пр.<br />\r\nЭти же ноутбуки часто подаются как простейший ноутбук для ребенка младшего школьного возраста.&nbsp;</p>\r\n\r\n<p>Наиболее распространенным продуктом этого типа на сегодняшнем российском рынке является модель &nbsp;<strong><a href=\"/Nb/5049\" target=\"_blank\">Acer TravelMate B118-M</a></strong>.<br />\r\n<img alt=\"Acer TravelMate B118-M\" src=\"/static/marketability/pict/how/acer_travelmate_b118-M.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /></p>\r\n\r\n<p><em>Acer TravelMate B118-M.</em></p>\r\n\r\n<p>Кстати, - это практически самая дешевая модель на наших полках - ценник здесь в районе 15 тыс. руб.<br />\r\nКорпус имеет защиту от ударов.<br />\r\nКонфигурация, впрочем, на сегодня слабовата - процессор Celeron N4120 (Gemini Lake) и 4 ГБ памяти. Но с базовыми задачами коммуникационного и просмотрового плана этот ноутбук справится.&nbsp;</p>\r\n\r\n<h3>Ноутбуки-трансформеры 2-в-1 низкой производительности</h3>\r\n\r\n<p>Мини-ноутбуки 10-11,6&rdquo; c поворотным сенсорным экраном являются гибридом ноутбука и планшета.&nbsp;<br />\r\nКстати, это одна из любимых позиций в деле массовых государственных закупок ноутбуков для школьного образования. На розничный рынок попадают далеко не все из фактически завозимых в Россию моделей, но некоторые все-таки &nbsp;в продаже &nbsp;встретить можно.&nbsp;<br />\r\nИ это действительно очень неплохой вариант ноутбука для школьника. Особенно если ребенок в младших и средних классах. Сегодня доступно много образовательного ПО, чей интерфейс (визуальное представление) и требования к начинке оптимизированы для работы на таких маленьких дисплеях и в маломощной конфигурации.&nbsp;<br />\r\nВ целом же, по сценариям использования о мини-трансформерах можно сказать все то же, что и об обычных мини-ноутбуках, но с добавлением большего удобства работы вне стола, как с планшетом.&nbsp;</p>\r\n\r\n<p>В качестве примера можно привести мини-трансформер <strong><a href=\"/Nb/4880\" target=\"_blank\">Lenovo&nbsp;IdeaPad Flex 3 11ADA05</a></strong>.</p>\r\n\r\n<p><img alt=\"Lenovo IdeaPad Flex 3 11ADA05\" src=\"/static/marketability/pict/how/lenovo_ip_flex_3_11ADA05.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /><br />\r\n<em>Lenovo IdeaPad Flex 3 11ADA05</em><br />\r\nУстройство имеет далеко не самую свежую начинку - процессор AMD 3020e (Raven Ridge) и 4 ГБ ОЗУ. Но для школьника - вполне подойдет.</p>\r\n\r\n<p><a href=\"/Nb/?Просмотр_контента=Yes&amp;12_мини=Yes&amp;tabs=marketability\" target=\"_blank\"><strong>Наиболее популярные мини-ноутбуки и трансформеры от ведущих брендов можно посмотреть здесь.</strong></a><br />\r\nТакже достаточно много моделей такого плана имеется у менее известных брендов включая и российские. Такие как <strong>Digma</strong>, <strong>Irbis</strong>, <strong>Prestigio</strong>, <strong>iRu</strong>.</p>\r\n\r\n<h3>Недорогие модели с экраном 14&rdquo;</h3>\r\n\r\n<h4>Самые дешевые</h4>\r\n\r\n<p>Типоразмер 14&rdquo; - с одной стороны обеспечивает нормальную&nbsp;работу&nbsp;с большинством обычных приложений, в том числе и&nbsp;комфортную работу&nbsp;с&nbsp;офисными пакетами. С другой стороны - такой ноут достаточно компактен, чтобы брать его&nbsp;с собой. Именно поэтому 14-дюймовый формат ноутбуков особенно любим в бизнес-среде.&nbsp;<br />\r\nВ этом классе выделяется бюджетный сегмент, построенный на базе экономичных&nbsp;процессоров Celeron/Pentium Silver N-series.</p>\r\n\r\n<p><strong><a href=\"/Nb/?14inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\" target=\"_blank\">Наиболее продаваемые модели этого класса можно посмотреть здесь.</a></strong></p>\r\n\r\n<p>Стоимость таких ноутбуков примерно от 25 до 35 тыс. руб.&nbsp;<br />\r\nМожно обратить внимание на дешевую модель <a href=\"/Nb/4956\" target=\"_blank\"><strong>Lenovo V14-IGL</strong></a>.</p>\r\n\r\n<p><img alt=\"Lenvovo V14-IGL\" src=\"/static/marketability/pict/how/lenovo_v14_igl.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /></p>\r\n\r\n<p><em>Lenovo V14-IGL</em></p>\r\n\r\n<p>Линейка Lenovo V - относится&nbsp;к классу коммерческих ноутбуков. Такие модели&nbsp;предназначены для поставки на массовые рабочие места в организации. Как правило, они обладают более высокой надежностью и качеством сборки, чем дешевые потребительские серии.<br />\r\nЭта машина стоит от 25 тыс. Правда конфигурация здесь не очень сильная - процессор Celeron Gemini Lake и 4 ГБ ОЗУ.</p>\r\n\r\n<p>Если попытаться подобрать в том же ценовом диапазоне систему помощнее, можно посмотреть на популярную серию <strong><a href=\"/Nb/3420\" target=\"_blank\">HP 14s-dq0</a></strong>. Среди многочисленных вариантов комплектации здесь можно найти конфигурации с 8 ГБ ОЗУ и чуть более мощным процессором Pentium Silver.</p>\r\n\r\n<h4>Ноутбуки 14&quot; с полноценной начинкой</h4>\r\n\r\n<p>Довольно сложно сегодня найти систему ценой ниже 35 тыс. с процессором стандартных семейств Intel Core или AMD Ryzen. В среднем цены на такие конфигурации начинаются уже от 40 тыс. руб. Но попадаются отельные модели с комлектациями на Pentium Gold/i3 или Athlon/Ryzen 3. Они оказываются более доступны по цене.</p>\r\n\r\n<p><br />\r\n<strong><a href=\"/Nb/?14inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\" target=\"_blank\">Наиболее популярные ноутбуки 14&rdquo; со стандартными мобильными процессорами и встроенного графикой можно посмотреть здесь.</a></strong></p>\r\n\r\n<p>Самыми доступными здесь являются потребительские ноутбуки серии <strong><a href=\"/Nb/4687\" target=\"_blank\">HP 14s-fq0</a></strong> (AMD) или <strong><a href=\"/Nb/4856\" target=\"_blank\">HP 14s-dq2</a></strong> (Intel Tiger Lake).</p>\r\n\r\n<p><img alt=\"HP 14s-fq0000\" src=\"/static/marketability/pict/how/hp_14s_fq0.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /></p>\r\n\r\n<p><em>HP 14s-fq0000</em></p>\r\n\r\n<p>Комплектацию на Pentium Gold 7505 с 8 ГБ здесь можно встретить примерно за 30 тыс. руб.</p>\r\n\r\n<h3>Доступные 15-дюймовые ноутбуки</h3>\r\n\r\n<p>Экран 15,6&rdquo; - наиболее распространенная позиция на рынке мобильных ПК. Такой форм-фактор даже называют &ldquo;стандартный типоразмер&rdquo;.&nbsp;<br />\r\nЭти системы обычно весят&nbsp;в районе&nbsp;2 кг. В целом&nbsp;предназначены для замены настольного компьютера. И&nbsp;являются&nbsp;универсальным инструментом для работы за домашним или офисным столом.</p>\r\n\r\n<p><br />\r\n<strong><a href=\"/Nb/?15inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\" target=\"_blank\">Список популярных моделей 15-дюймовых ноутбуков с процессорами начального уровня Celeron и Pentium silver можно посмотреть здесь.</a></strong></p>\r\n\r\n<p><br />\r\nМожно посмотреть, например, на ноутбук <strong><a href=\"/Nb/5050\" target=\"_blank\">Asus A516MA</a></strong> - на базе Pentium Silver N5030 Gemini Lake c 8 ГБ ОЗУ стоимостью до 30 тыс. руб.</p>\r\n\r\n<p><img alt=\"Asus A516MA\" src=\"/static/marketability/pict/how/asus_a516M.png\" style=\"margin-top: 10px; margin-bottom: 10px; width: 100%;\" /></p>\r\n\r\n<p><em>Asus A516MA</em></p>\r\n\r\n<p>Правда экран у этой модели&nbsp;имеет разрешение лишь HD, что для дисплея такой диагонали явно маловато.</p>\r\n\r\n<p>Модель <strong><a href=\"/Nb/2775\" target=\"_blank\">Acer Extensa 215-31</a></strong> - подороже,&nbsp;до 35 тыс. руб. - но там уже нормальная матрица Full HD.&nbsp;</p>\r\n\r\n<p>По ценам от 30 до 40 тыс. рублей можно найти достаточно много 15&rdquo; моделей с полноценными процессорами Pentium Gold и Athlon либо Core i3 или Ryzen 3. Чаще всего это будут платформы не последнего поколения, но это вполне работоспособные машины. Они&nbsp;позволяют решать большинство стандартных пользовательских задач. Как ноутбук для школьника старших классов и студента, для нетребовательных пользователей - это вполне достойный продукт.</p>\r\n\r\n<p><br />\r\n<strong><a href=\"/Nb/?15inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\" target=\"_blank\">Вот перечень наиболее продаваемых моделей со стандартными процессорами&nbsp;без претензий.</a></strong><br />\r\n&nbsp;<br />\r\n&nbsp;</p>','<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?tabs=marketability\">Выбрать ноутбук для своих целей и задач</a></h3>\r\n\r\n<div class=\"filter_button_big\">\r\n<div class=\"fltr_pic\"><a href=\"/Nb/?tabs=marketability\">&nbsp;</a></div>\r\n\r\n<div class=\"fltr_text\"><a href=\"/Nb/?tabs=marketability\">ФИЛЬТР</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?Просмотр_контента=Yes&amp;12_мини=Yes&amp;tabs=marketability\">Top мини-ноутбуков</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?Просмотр_контента=Yes&amp;12_мини=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?Просмотр_контента=Yes&amp;12_мини=Yes&amp;tabs=marketability\">Мини до 12&quot;</a></div>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?14inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">Top ноутов 14&quot; начального уровня</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?14inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?14inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">Компактный 14&quot;</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?CL_13-14=Yes&amp;CL_low_end=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?CL_13-14=Yes&amp;CL_low_end=Yes&amp;tabs=marketability\">Начального уровня</a></div>\r\n</div>\r\n\r\n<div>\r\n<div class=\"inarticle-rignt-filter\">\r\n<h3><a href=\"/Nb/?CL_15=Yes&amp;CL_low_end=Yes&amp;tabs=marketability\">Top ноутов 15&quot; начального уровня</a></h3>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?CL_15=Yes&amp;CL_low_end=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?15inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">Стандартный размер 15&quot;</a></div>\r\n\r\n<div class=\"filters-item-check\">\r\n<div class=\"filters-item-check-galka\"><a href=\"/Nb/?15inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">&nbsp;</a></div>\r\n<a href=\"/Nb/?15inch=Yes&amp;CPU_Бюджет=Yes&amp;GPU_Встроенный=Yes&amp;tabs=marketability\">Начального уровня</a></div>\r\n</div>\r\n</div>\r\n</div>','Nb','2021-09-09','/static/marketability/pict/how/nb_unexpensive.png',0,'Как выбрать недорогой ноутбук?','<p>&nbsp;</p>\r\n\r\n<p style=\"line-height:1.38\"><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">В целом, на стоимость мобильного ПК влияют несколько факторов.&nbsp;</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" style=\"list-style-type:disc\"><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Размер экрана. Фактически, именно форм-фактор, выражаемый в величине диагонали дисплея в дюймах, определяет и задачи, которые возлагаются на ноутбук: выездное мобильное устройство, устройство ограниченной мобильности, замена стационарного ПК.&nbsp;</span></span></span></span></span></span></li>\r\n	<li aria-level=\"1\" style=\"list-style-type:disc\"><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Основная начинка компьютера, его конфигурация: процессор, объем оперативной памяти, емкость и тип накопителя (диска).&nbsp;</span></span></span></span></span></span></li>\r\n	<li aria-level=\"1\" style=\"list-style-type:disc\"><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Естественно, общее &ldquo;качество&rdquo; - сборка, качество дисплея, материалы, бренд (торговая марка).</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" style=\"list-style-type:disc\"><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Стоит добавить также наличие установленной ОС Windows в конкретной модификации модели.</span></span></span></span></span></span></li>\r\n</ul>');
